class SearchBar extends Component {
  constructor(props) {
    super(props);
    this.state = {
      columns: [],
      data: [],
      isLoading: false,
    };
  }

  render = () => {
      return (
        <div style={{ display: 'inline-flex' }}>
          <div>
            <TextField
                    id="standard-name"
                    label="keyword"
                    margin="normal"/>
          </div>
          <div style={{ alignSelf: 'center' }}>
            <Button variant="outlined">
              Search
            </Button>
          </div>
        </div>
);
}
}




export default SearchBar;
